import React from 'react';
import './App.css';
import Player from './Player.js'

export default function PlayerList({ Players }){



    return(
        <div>
            <p>Hello</p>
            {Players.map(player => {
                return <Player key={player.Position} Player={player}/>
            })}
        </div>
    )
}


